import React, { useState, useEffect } from 'react'

function App() {
    const [data, setData] = useState([])

    useEffect(() => {
        fetch("http://localhost:5000/status", {
            'method': 'GET',
            headers: {
                'Content-Type': 'application/json'
            }
        })
            .then(res => res.json())
            .then(data => {
                setData(data)
                console.log(data)
                })
    }, [])

    return (
        <div>
        {typeof data.server_status}
        </div>
    )
}

export default App
